import{createInstance}from"../keyword/create-instance.min.js";import{Buildable}from"../interface/buildable.min.js";import{QualificationModel}from"../model/qualification-model.min.js";import{ThreadingUtility}from"../shared/utility/threading-utility.min.js";import{PageColorAdjuster}from"../shared/page-color-adjuster.min.js";import ScriptSeriesLoader from"../shared/script-series-loader.min.js";class QualificationController extends Buildable{constructor(){super(),this.model=new QualificationModel,this.scriptLoader=ScriptSeriesLoader,this.scriptLoader.add("https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js","jQuery"),this.scriptLoader.load()}static build=async()=>{const e=new QualificationController;for(;e.scriptLoader.running;)await ThreadingUtility.sleep(2e3);return e};execute=async()=>{const e=this.model.getQualifications();for(const i of e)$("div#qualification").append(`<p>${i.name} ${i.score}</p>`);(await createInstance(PageColorAdjuster)).changeBackgroundColor()}}export{QualificationController};